Delegator.register('blur','ValidateCoupon',function(event,el){alert('d');var value=el.value;if(!value.match(/\S/))
return;el.spin();return;this.ajaxRequest({url:document.location+"",data:{action:'validate_coupon',coupon_code:value},update:'an-sb-validation-msg'}).send()})
document.addEvent('click:relay(.confirm-tos)',function(){var allChecked=!0;document.getElements('.confirm-tos').each(function(el){if(allChecked&&!el.checked){allChecked=!1}});document.id('proceed').removeClass('disabled');if(!allChecked){document.id('proceed').addClass('disabled')}});document.addEvent('click:relay(#proceed)',function(e){el=e.target;if(el.hasClass('disabled')){e.stop()}})